const dummy = [
  {
    boardName: '자유게시판',
    boardLink: 'free',
    postList: [
      {
        postTitle: '게시물1',
      },
      { postTitle: '게시물2' },
    ],
  },
  {
    boardName: '유자게시판',
    boardLink: 'yuzu',
    postList: [
      {
        postTitle: '게시물1',
      },
      { postTitle: '게시물2' },
    ],
  },
];

function Main() {
  dummy.map((element) => {
    return (
      <div>
        <div>{element.boardName}</div>
        <div>{element.boardLink}</div>
      </div>
    );
  });
  return (
    <div>
      메인 페이지 입니다!
      <div>제목</div>
      <div>링크</div>
      <div>게시물</div>
    </div>
  );
}

export default Main;
